import React, { useContext } from "react";
import { UserContext } from "../contexts/userContext";

const UserList = () => {
	const userContext = useContext(UserContext)
  const { userList } = userContext.consumer
	return (
			<>
				{userList}
			</>
	);
}

export default UserList;
